import ImgSlider from "../../mainslider/ImgSlider";
import styled from "styled-components";
import SideBarForOtherComponentsThanHome from "../SideBarForOtherComponentsThanHome";
import TreatmentDetailsContainer from "./TreatmentDetailsContainer";
import { BrowserRouter,Router,Route } from "react-router-dom";
// import RegisterForAppointment from "../RegisterForAppointment";

// importing various contaner
import TestContainer from "./TestContainer";
import MedicalIssueContainer from "./MedicalIssueContainer";
import MentalHealthContainer from "./MentalHealthContainer";
import SurgicalProcedureContainer from "./SurgicalProcedureContainer";
import CareAndSupportContainer from "./CareAndSupportContainer";

export default function TreatmentMainPage() {
  let slidersetting = {
    slidetoshow: 3,
  };

  let data = [
    {
      img: "/Images/bacgroundImg(1).jpg",
      disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
    },
    {
      img: "/Images/bacgroundImg(2).jpg",
      disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
    },
    {
      img: "/Images/bacgroundImg(3).jpg",
      disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
    },
    {
      img: "/Images/bacgroundImg(4).jpg",
      disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
    },
    {
      img: "/Images/bacgroundImg(5).jpg",
      disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
    },
  ];

  let ImgUrlsForSideBar = [
    {
      id: 1,
      child: (
        <>
          <p className="flex mx-1 w-18">Test</p>
          <img
            className="w-12 ImgContainer"
            src="/ImagesForTreatmentPage/test.png"
            alt="MyHospitalWebApp"
          />
        </>
      ),
      valueToSet: <TestContainer />,
      style: "rounded-tr-md",
    },
    {
      id: 2,
      child: (
        <>
          <p className="mx-1 w-18">Medical Issue</p>
          <img
            className="w-12 ImgContainer"
            src="/ImagesForTreatmentPage/MedicalIssue.png"
            alt="MyHospitalWebApp"
          />
        </>
      ),
      valueToSet: <MedicalIssueContainer />,
    },
    {
      id: 3,
      child: (
        <>
          <p className="mx-1 w-18"> Mental Health </p>
          <img
            className="w-12 ImgContainer "
            src="/ImagesForTreatmentPage/MentalHealth.png"
            alt="MyHospitalWebApp"
          />
        </>
      ),
      valueToSet: <MentalHealthContainer />,
    },
    {
      id: 4,
      child: (
        <>
          <p className="mx-1 w-18">Surgical Procedure</p>
          <img
            className="w-12 ImgContainer "
            src="/ImagesForTreatmentPage/SurgicalProcedure.png"
            alt="MyHospitalWebApp"
          />
        </>
      ),
      valueToSet: <SurgicalProcedureContainer />,
    },
    {
      id: 5,
      child: (
        <>
          <p className="mx-1 w-18 ">Care And Support</p>
          <img
            className="w-12 ImgContainer"
            src="/ImagesForTreatmentPage/CareAndSupport.png"
            alt="MyHospitalWebApp"
          />
        </>
      ),
      valueToSet: <CareAndSupportContainer />,
      style: "rounded-br-md",
    },
  ];

  return (
    <TreatmentImageDivContainer>
      <ImgSlider data={data} slidersetting={slidersetting} />
      <BrowserRouter>
        <Router>
          <Route path="/" element={<TreatmentDetailsContainer />} />
          <Route path="/Test" element={<TestContainer/>} />
          <Route path="/MedicalIssue" element={<MedicalIssueContainer />} />
          <Route path="/MentalHealth" element={<MentalHealthContainer />} />
          <Route path="/SurgicalProcedure" element={<SurgicalProcedureContainer/>} />
          <Route path="/CareAndSupport" element={<CareAndSupportContainer />} />
        </Router>
      </BrowserRouter>
      {/* <RegisterForAppointment /> */}
      <SideBarForOtherComponentsThanHome
        ImgUrlsForSideBar={ImgUrlsForSideBar}
      />
    </TreatmentImageDivContainer>
  );
}
const TreatmentImageDivContainer = styled.div`
  position: relative;
  top: 60px;
`;
